import { MoreVertical, ArrowRight, ArrowLeft, LogOut, LayoutDashboard, BarChart3, UserCircle, Boxes, Package, Receipt, Settings, LifeBuoy } from "lucide-react";
import { useContext, createContext, useState } from "react";

const SidebarContext = createContext();

export default function Sidebar({ children }) {
  const [expanded, setExpanded] = useState(true);

  return (
    <aside className="h-screen">
      <nav className="h-full inline-flex flex-col bg-blue-400 border-r shadow-sm ml-6 my-6 rounded-xl">
        <div className="p-4 pb-2 flex justify-between items-center">
          <button
            onClick={() => setExpanded((curr) => !curr)}
            className="p-1.5 rounded-lg "
          >
            {expanded ? <ArrowLeft /> : <ArrowRight />}
          </button>
        </div>

        <SidebarContext.Provider value={{ expanded }}>
          <ul className="flex-1 px-3">{children}</ul>
        </SidebarContext.Provider>

        <div className="border-t flex p-3">
          <LogOut />
          <div
            className={`
              flex justify-between items-center
              overflow-hidden transition-all ${expanded ? "w-52 ml-3" : "w-0"}
          `}
          >
            <div className="leading-4">
              <h4 className="font-semibold">Logout</h4>
            </div>
            <MoreVertical size={20} />
          </div>
        </div>
      </nav>
    </aside>
  );
}

export function SidebarItem({ icon, text, active, alert }) {
  const { expanded } = useContext(SidebarContext);

  return (
    <li
      className={`
        relative flex items-center py-2 px-3 my-1
        font-medium rounded-md cursor-pointer
        transition-colors group
        ${
          active
            ? "bg-gradient-to-tr from-indigo-200 to-indigo-100 text-black"
            : "hover:bg-indigo-50 text-gray-600"
        }
    `}
    >
      {icon}
      <span
        className={`overflow-hidden transition-all ${
          expanded ? "w-52 ml-3" : "w-0"
        }`}
      >
        {text}
      </span>
      {alert && (
        <div
          className={`absolute right-2 w-2 h-2 rounded bg-red-700 ${
            expanded ? "" : "top-2"
          }`}
        />
      )}

      {!expanded && (
        <div
          className={`
          absolute left-full rounded-md px-2 py-1 ml-6
          bg-indigo-100 text-black text-sm
          invisible opacity-20 -translate-x-3 transition-all
          group-hover:visible group-hover:opacity-100 group-hover:translate-x-0
      `}
        >
          {text}
        </div>
      )}
    </li>
  );
}

// Menggabungkan Sidebar dengan Form Input Data Diri
export function App() {
  return (
    <div className="flex">
      {/* Sidebar */}
      <Sidebar>
        <SidebarItem icon={<LayoutDashboard size={20} />} text="Soal" alert active />
        <SidebarItem icon={<BarChart3 size={20} />} text="Lembaga" />
        <SidebarItem icon={<UserCircle size={20} />} text="Users" />
        <SidebarItem icon={<Boxes size={20} />} text="Inventory" />
        <SidebarItem icon={<Package size={20} />} text="Order" />
        <SidebarItem icon={<Receipt size={20} />} text="Bills" />
        <hr className="my-3" />
        <SidebarItem icon={<Settings size={20} />} text="Settings" />
        <SidebarItem icon={<LifeBuoy size={20} />} text="Help" />
      </Sidebar>

      {/* Form Input Data Diri */}
      <div className="flex flex-grow justify-center items-center h-screen">
        <div className="bg-white mr-60 rounded-lg shadow-2xl p-12 w-[70%] max-w-[800px]">
          <h2 className="text-2xl mb-8 font-bold text-left">Input Data Diri</h2>
          <form className="space-y-6">
            <div className="input-group flex flex-col mb-5 w-full">
              <label className="text-sm mb-2">Nama Peserta</label>
              <input 
                type="text" 
                placeholder="Nama Peserta" 
                className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full" 
              />
            </div>
            <div className="input-group flex flex-col mb-5 w-full">
              <label className="text-sm mb-2">Deskripsi</label>
              <input 
                type="text" 
                placeholder="Deskripsi" 
                className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full" 
              />
            </div>
            <div className="input-group flex flex-col mb-5 w-full">
              <label className="text-sm mb-2">Nama Instansi</label>
              <input 
                type="text" 
                placeholder="Nama Instansi" 
                className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full" 
              />
            </div>
            <button 
              type="submit" 
              className="submit-btn bg-black text-white py-2 px-8 rounded-full cursor-pointer text-base mt-8 self-end hover:bg-gray-800"
            >
              Selesai
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}
